      to:'doge'
    })}

dogevalidation = (event2)=>{
  const value100=event2.target.value
  this.setState({
    rec_address:value100
  })
  if (value100[0]!='D') {
    this.setState({
      show:'block',
      moveahead:'no'
    })
  }
  if (value100[0]=='D') {
    this.setState({
      show:'none',
      moveahead:'yes'
    })
  }
  if (value100[0]==null) {
    this.setState({
      show:'none',
      moveahead:'no'
    })
  }
}

btcvalidation = (event2)=>{
  const value100=event2.target.value
  this.setState({
    rec_address:value100
  })
  if (value100[0]!='3' && value100[0]!='1' && (value100[0]!='b' && value100[1]!='c') ) {
    this.setState({
      show:'block',
      moveahead:'no'
    })
  }
  if (value100[0]=='3' || value100[0]=='1' || (value100[0]=='b' && value100[1]=='c') ) {
    this.setState({
      show:'none',
      moveahead:'yes'

    })
  }
  if (value100[0]==null) {
    this.setState({
      show:'none',
      moveahead:'no'
    })
  }
}

xmrvalidation = (event2)=>{
	const value100=event2.target.value
